品牌简介
  CASIO卡西欧的品牌故事     卡西欧(CASIO)手表是日本三大品牌之一，多年来以真正多功能的G-SHOCK手表著称于世。卡西欧手表所代表的活力、年轻、时尚、多功能的品牌形象已深入民心。卡西欧公司一向以技术领先于同行为己任，历年都会有技术的突破。  将高、精、尖的先进科技结合新型液晶技术，恰当地运用于腕上时计，不断地提高腕上时计的发展水平——卡西欧一贯以来所倡导的“腕上科技”精神在中国国内也被得以沿袭和传播。 卡西欧手表有两大类别，一种是运动休闲形象的跳字表；一种是年轻时尚的指针表。一年四季会因应季节的变化推出当季的特色产品和新品，如每年的夏季和冬季 G-SHOCK和BABY-G都会有适合夏季和冬季极限运动的极限腕表推出；海豚鲸鱼纪念版、夏季珊瑚系列、PUPPY系列、情侣对表等等。今年卡西欧产品的重点将强调功能，如太阳能、10年电池、超强背光等卡西欧的强势功能。 1981年，28岁的CASIO研发部职员伊部菊雄摔坏了高考时老爸送的手表，决心研发手表的防震功能。他的试验场地就是卡西欧当时的办公楼三层，高度正好10米，研制成功好，他们认为这只手表抗拒了地心引力的伤害，就取了重力单词的第一个字母G加上冲击SHOCK。从83年第一支G-SHOCK问世到现在，G-SHOCK经过了低潮、转折，25年来创造出了自己的流行文化，G-SHOCK也衍生出各种风格不同的系列。 CASIO手表中，专为时尚女性而设计的Baby-G系列一向以时尚、叛逆、性感的风格著称。从1994年诞生的第一款Baby-G开始，在延续G-SHOCK抗震防水的标志性功能外，更是注入充满时尚元素的设计，受到世界各地潮流人士的热捧。                

